def count_possible_numbers(N: int) -> int:
    neigh = [[0, 8], [1, 2, 4], [1, 2, 3, 5], [2, 3, 6], [1, 4, 5, 7], [2, 4, 5, 6, 8], [3, 5, 6, 9], [4, 7, 8], [5, 7, 8, 9, 0], [6, 8, 9]]
    dp = [+1 for _ in range(10)]
    ans = [1 for _ in range(10)]
    for n in range(2, N + 1):
        for k in range(10):
            res = 0
            for i in neigh[k]:
                res += ans[i]
            dp[k] = res
        ans = dp[:]
        dp = [-1 for _ in range(10)]
    return sum(ans)

